export default function UserSettings() {
  return (
    <>
      <main className="chat-box">
          <h1>Profile Photo</h1>
          <form>
              <input type="file" name="imagename" className="btn"/>
              <input type="submit" className="btn"/>
          </form>
          </main>
    </>
  );
}
